function Movie(props) {


    return (
        <div>

        {
               props.item.map( 
                   (expense) => {
                       return (
                       <ExpenseItem 
                           key = { expense.id }
                           date={ expense.date }
                           title={ expense.title }
                           amount={ expense.amount } />

               )
                       }
                       )
       }

       </div>
    )

}

export default Movie;
